INSERT INTO `v1_9fb6fe7c37eac0470f6544c0b286d93e3461fa55e98cf17117f2d6d034deef18` VALUES (0.2, 513, 513044, "", 1, "", 3, 100811, "", "", "nop_talk_thinking");
